// ==UserScript==
// @name         Auto Claim Twitch drop
// @version      0.69.421
// @description  Auto clicking "Click to claim a drop" under the chat
// @author       bAdRock
// @match        https://www.twitch.tv/drops/inventory*
// @run-at       document-end
// @icon         data:image/jpeg;base64,
// @grant        none
// @namespace https://greasyfork.org/users/548266
// ==/UserScript==

const claimButton = '[data-test-selector="DropsCampaignInProgressRewardPresentation-claim-button"]';
var onMutate = function(mutationsList) {
	mutationsList.forEach(mutation => {
		if(document.querySelector(claimButton)) document.querySelector(claimButton).click();
	})
}
var observer = new MutationObserver(onMutate);
observer.observe(document.body, {childList: true, subtree: true});

setInterval(function() {
                  window.location.reload();
                }, 15*60000); 
